import { createGlobalStyle } from "styled-components";

const MovesStyle = createGlobalStyle`
    .moves-container {
        height: 40vw;
        width: 20vw;
        background-color: var(--light-grey);
        margin-left: 5vw;
        border-radius: 5%;
    }
`

function Moves({ moves }) {

    // const moveItems = moves.map(moveArray => {
    //     <li key={}></li>
    // });
    const moveItems = [];
    for (let i = 0; i < moveItems.length; i++) {
        moveItems.push(
            <li key={i}>{moves[i][0]}{moves[i][1]}</li>
        );
    };

    return (
        <>
            <MovesStyle />
            <div className='moves-container'>
                <ul>{moveItems}</ul>
            </div>
        </>
    );
}

export default Moves;
